import axios from 'axios'

const api = axios.create({
    baseURL: 'http://localhost:3000/api' || 'http://localhost:' + process.env.port + '/api',
})

export const pipeBis = () => api.get(`/`)

const apis = {
    pipeBis
}

export default apis
